package _6EF887840EAF432DA4100AE0897CBA3 / overwrite=yes;
    dcl package pymas py;
    dcl package logger logr('App.tk.MAS');
    dcl varchar(67108864) character set utf8 pycode;
    dcl int revision;

    method score(
        double CRIM,
        double ZN,
        double INDUS,
        double CHAS,
        double NOX,
        double RM,
        double AGE,
        double DIS,
        double RAD,
        double TAX,
        double PTRATIO,
        double B,
        double LSTAT,
        in_out double var1,
        in_out integer rc,
        in_out char msg
        );

        if null(py) then do;
            py = _new_ pymas();
            rc = py.useModule('mypymodule', 1);
            if rc then do;
                rc = py.appendSrcLine('try:');
                rc = py.appendSrcLine('    import pickle, base64');
                rc = py.appendSrcLine('    bytes = b""');
                rc = py.appendSrcLine('    obj = pickle.loads(base64.b64decode(bytes))');
                rc = py.appendSrcLine('    _compile_error = None');
                rc = py.appendSrcLine('except Exception as e:');
                rc = py.appendSrcLine('    _compile_error = e');
                rc = py.appendSrcLine('');
                rc = py.appendSrcLine('def wrapper(CRIM, ZN, INDUS, CHAS, NOX, RM, AGE, DIS, RAD, TAX, PTRATIO, B, LSTAT):');
                rc = py.appendSrcLine('    "Output: var1, msg"');
                rc = py.appendSrcLine('    result = None');
                rc = py.appendSrcLine('    try:');
                rc = py.appendSrcLine('        global _compile_error');
                rc = py.appendSrcLine('        if _compile_error is not None:');
                rc = py.appendSrcLine('            raise _compile_error');
                rc = py.appendSrcLine('        msg = ""');
                rc = py.appendSrcLine('        import numpy as np');
                rc = py.appendSrcLine('        result = obj.predict(np.array([CRIM,ZN,INDUS,CHAS,NOX,RM,AGE,DIS,RAD,TAX,PTRATIO,B,LSTAT]).reshape((1, -1)))');
                rc = py.appendSrcLine('        if result.size == 1:');
                rc = py.appendSrcLine('            result = np.asscalar(result)');
                rc = py.appendSrcLine('    except Exception as e:');
                rc = py.appendSrcLine('        msg = str(e)');
                rc = py.appendSrcLine('        if result is None:');
                rc = py.appendSrcLine('            result = tuple(None for i in range(1))');
                rc = py.appendSrcLine('    if isinstance(result, tuple):');
                rc = py.appendSrcLine('        return tuple(x for x in list(result) + [msg])');
                rc = py.appendSrcLine('    else: ');
                rc = py.appendSrcLine('        return result, msg');
                pycode = py.getSource();
                revision = py.publish(pycode, 'mypymodule');
                if revision lt 1 then do;
                    logr.log('e', 'py.publish() failed.');
                    rc = -1;
                    return;
                end;
            end;
            rc = py.useMethod('wrapper');
            if rc then return;
        end;
        rc = py.setDouble('CRIM', CRIM);    if rc then return;
        rc = py.setDouble('ZN', ZN);    if rc then return;
        rc = py.setDouble('INDUS', INDUS);    if rc then return;
        rc = py.setDouble('CHAS', CHAS);    if rc then return;
        rc = py.setDouble('NOX', NOX);    if rc then return;
        rc = py.setDouble('RM', RM);    if rc then return;
        rc = py.setDouble('AGE', AGE);    if rc then return;
        rc = py.setDouble('DIS', DIS);    if rc then return;
        rc = py.setDouble('RAD', RAD);    if rc then return;
        rc = py.setDouble('TAX', TAX);    if rc then return;
        rc = py.setDouble('PTRATIO', PTRATIO);    if rc then return;
        rc = py.setDouble('B', B);    if rc then return;
        rc = py.setDouble('LSTAT', LSTAT);    if rc then return;
        rc = py.execute();    if rc then return;
        var1 = py.getDouble('var1');
        msg = py.getString('msg');
    end;

endpackage;

